    true,nt"url": null,nt"notes": "The Document Management System will provide
    FHWA the capability to integrate document creation, storage, and transfer with critical
    business process applications. The electronic DMS is comprised of 2 components:
    (1) a SharePoint solution delivered as a temporary solution for 3 field offices
    that were using GroupWise, that was intended to provide a temporary solution while
    FHWA explored other enterprise Document and Records Management solutions that better
    served the needs of the entire mode. This is operational, and It will be decommissioned
    upon implementation of the enterprise solution. (2) the Enterprise Document and
    Records Management solution. We have completed the initial requirements phase.?",nt"license_title":
